import React from 'react'

export default function FeaturedInfo(props) {
    const { item } = props;
    return (
        <div>
            <img src={item?.image} alt="" />
            <h1>{item?.title}</h1>
            <h3>{item?.Goal}</h3>
            <h3>{item?.Description}</h3>
            <h3>{item?.Organizer}</h3>
        </div>
    )
}
